import React from "react";


const Recipe= ({allRecipes})=>{

    return (
        <React.Fragment>
           { 
            allRecipes.map(r=>(
                <ul key={r.id}>
                    <p>{r.id}</p>
                    <p>{r.name}</p>

                </ul>
            ))
           
           }
        </React.Fragment>
    )
}

export default Recipe;
